// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface PriceConsumerInterface {
    function getLatestPriceOfUSDT() external returns (int256, uint256);
}

// curently only gets rates from given source
contract PicingFromV3Agregator {
    PriceConsumerInterface priceConsumer;
    int256 currentRate;
    uint256 currentDeciamls;
    // very basic version - rate is needed for every charge !!!
    event rate(int256, uint256);

    function addPriceFeed(address _PriceConsumerInterfaceAddress) public {
        priceConsumer = PriceConsumerInterface(_PriceConsumerInterfaceAddress);
    }

    function getAddressOfpriceFeed() public view returns (address) {
        return address(priceConsumer);
    }

    function setRate() public returns (bool) {
        (currentRate, currentDeciamls) = priceConsumer.getLatestPriceOfUSDT();
        emit rate(currentRate, currentDeciamls);
        return true;
    }

    function getRate() public view returns (int256, uint256) {
        return (currentRate, currentDeciamls);
    }
}

